    private async Task HandleValidSubmit()
    {
        newProduct.Variants = VariantService.GetSelectedVariants();
        var response = await ProductService.AddProduct(newProduct);
        if (response.Success)
        {
            NavigationManager.NavigateTo($"/product/{response.Id}");
        }
    }

